.
Easily the most difficult part of studying erotics is how often I'm exposed to the very real consequences of the politics of attraction. The objects of our desires and the means through which we express that desire are never accidental and maintain hierarchy and stability. 
.
However, for somone who exists outside of that stability, who experiences fluidity between genders and sexualities, desirability becomes a falsehood. And while that's liberating, I nonetheless crave what I cannot attain through any conventional means: beauty. 
.
And that is the most unhealthy part of myself. That no matter how much I see through the falsehood of desirability and its roots in anti-queer aesthetics, I still deeply want to be desired. I live for it. I am nothing but an object to be desired. That is a femme's burden.
.
.
